import { Link } from 'react-router-dom';

export default function Error() {
    return (
        <Row className="justify-content-center">
            <Col className="mt-5 pt-5 text-center">
                <h1>404 Error</h1>
                <p>Page Not Found</p>
                <Link className="btn btn-primary" to="/">Return to Home</Link>
            </Col>
        </Row>
    );
}
